import React from "react";
import { createStore } from "redux"

const counterReducer = (state, action) =>{
    switch(action.type){
        case 'increment':
            return {};
        case 'increse':
            return {};
        case 'decrement':
            return {};

    }
} 

const store = createStore(counterReducer);

export default store;
